query:
/*+ NoMergeJoin(mk t) NoHashJoin(mk t ci) */ select count(*)
from movie_keyword AS mk
inner join title AS t
on t.id = mk.movie_id AND mk.keyword_id = 875 AND t.kind_id < 4 AND t.production_year < 2012
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id = 179056 AND ci.role_id > 2;
